import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Board from './board';

const Game = () => {
  return (
    <div className="game">
      <h1>it works</h1>
      <Board></Board>
    </div>
  );
};

// ========================================

ReactDOM.render(<Game />, document.getElementById("root"));
